import { Button, CircularProgress } from '@mui/material'
import { useNavigate, useParams } from 'react-router-dom'

import useDeleteParticipator from '@/hooks/festival/useDeleteParticipator'
import useFestivalById from '@/hooks/festival/useFestivalById'

const FestivalDetailPage = () => {
  const { id } = useParams()
  const { data: festival, isLoading } = useFestivalById(Number(id))
  const navigate = useNavigate()
  const { mutate: deleteParticipator } = useDeleteParticipator()
  if (isLoading) {
    return <CircularProgress />
  }

  if (!festival) {
    return <div>축제 정보를 불러오지 못했습니다.</div>
  }

  return (
    <div style={{ padding: '20px' }}>
      <h1>{festival.title} ({festival.year})</h1>
      <p><strong>태그:</strong> {festival.tag}</p>
      <p><strong>설명:</strong> {festival.description}</p>
      <p><strong>요약:</strong> {festival.summary}</p>
      <p><strong>참여비:</strong> {festival.participationFee}원</p>
      <p><strong>예약 가능 여부:</strong> {festival.reservationAvaliable ? '가능' : '불가능'}</p>
      <p><strong>예약 타입:</strong> {festival.reservationType}</p>
      <p><strong>위치:</strong> {festival.location} ({festival.locationLocal}, {festival.specificLocation})</p>
      <p><strong>국가:</strong> {festival.nation}</p>
      <p><strong>도시:</strong> {festival.city} ({festival.cityLocal})</p>
      <p><strong>구:</strong> {festival.subCity} ({festival.subCityLocal})</p>
      <p><strong>좌표:</strong> {festival.latitude}, {festival.longitude}</p>
      <p><strong>공개 여부:</strong> {festival.visible ? '공개' : '비공개'}</p>
      <p><strong>축제 기간:</strong> {new Date(festival.openedAt).toLocaleDateString()} ~ {new Date(festival.expiredAt).toLocaleDateString()}</p>

      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h1>참여부스 명단</h1>
        <Button
          variant="contained"
          style={{ backgroundColor: '#01c897', color: 'white' }}
          onClick={() => navigate('participator/create')}
        >
          부스 생성
        </Button>
      </div>
      {festival.participators && festival.participators.length > 0 ? (
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          {festival.participators.map((participator) => (
            <li
              key={participator.id}
              style={{ marginBottom: '10px', borderRadius: '10px', border: '1px solid black', padding: '10px 10px' }}>
              <strong>{participator.name}</strong> (부스 번호: {participator.boothNumber})<br />
              <span style={{ fontStyle: 'italic' }}>{participator.description}</span>
              <button onClick={() => { (id != undefined) ?? deleteParticipator({ festivalId: Number(id), participatorId: participator.id }) }}>삭제</button>
            </li>
          ))}
        </ul>
      ) : (
        <p>참여 부스가 없습니다.</p>
      )}
    </div>
  )
}

export default FestivalDetailPage
